import React from "react";
import ProjectCard from "./ProjectCard";
import Header from "./Header";
import Footer from "./Footer";

const MainPage = () => {
  const projects = [
    {
      key: "as",
      title: "primero",
      image: "./src/assets/images/calc.jpg",
      deployed: "facebook.com",
      code: "github.com",
    },
    {
      key: "ad",
      title: "segundo",
      image: "./src/assets/images/calc.jpg",
      deployed: "facebook.com",
      code: "github.com",
    },
  ];

  return (
    <>
      <Header></Header>
      <ProjectCard> {projects.as} </ProjectCard>
      <Footer></Footer>
    </>
  );
};

export default MainPage;
